import React from 'react';
import { Button, DataTable } from 'carbon-components-react';
import logo from './logo.svg';
import './App.css';

function App() {
  const { Table, TableHead, TableHeader, TableBody, TableCell } = DataTable;
  return (
    <div className="App">
      <Button>CarbonButton</Button>
      <DataTable></DataTable>
      <DataTable.TableHead/>
      <DataTable.TableHeader/>

    </div>
  );
}

export default App;
